import React, { useState } from "react";
import reactDom from "react-dom";
import cont from "./assets/bg-content.png";
import Modal from "react-bootstrap/Modal";
import prevButton from './assets/button-prev.png';
import nextButton from './assets/button-next.png';


import Button from "react-bootstrap/Button";
import contentImg from "./assets/bg-content.png";
import contentImage01 from "./assets/image-content-01.jpg";

export default function CustomModal(props) {
  return (
    <Modal
    {...props}
    size="lg"
    aria-labelledby="contained-modal-title-vcenter"
    centered
  >
    <Modal.Header closeButton>
      <Modal.Title id="contained-modal-title-vcenter">
       
      </Modal.Title>
    </Modal.Header>
    <img src = {contentImage01} />
    <Modal.Body>
      <h4></h4>
      <p>

      </p>
    </Modal.Body>
    <Modal.Footer>
    <Button > <img src = {nextButton}  id="next" /> </Button>
    <Button > <img src = {prevButton} id="prev" /> </Button>
    </Modal.Footer>

  </Modal>
  );
}
